function activeScrollpy(){$("body").scrollspy({target:".navbar"})}function capitalizeFirstLetter(t){return t.charAt(0).toUpperCase()+t.slice(1)}function setCard(t,e){$(".meetup-link").eq(t).attr("href",e.data[t].link),$(".caption h3").eq(t).text(e.data[t].name),$(".caption h4").eq(t).text(e.data[t].venue.name),$(".caption h5").eq(t).text(e.data[t].venue.address_1),$(".caption h6").eq(t).text(capitalizeFirstLetter(moment(e.data[t].time).format("dddd, D MMMM, hh:mmA"))),"EkoSpace"===e.data[t].venue.name?$(".thumbnail img").eq(t).attr("src","./dist/img/ekospace.svg"):"Nuevo AreaTres"===e.data[t].venue.name&&$(".thumbnail img").eq(t).attr("src","./dist/img/areatres.svg")}function nextMeetups(){$.ajax({type:"GET",url:"https://api.meetup.com/FreeCodeCampBA/events?photo-host=public&page=2&sig_id=471f4512414422381c386239397b703d",data:"data",dataType:"jsonp",success:function(t){setCard(0,t),setCard(1,t)}})}$(function(){activeScrollpy(),nextMeetups()});